   "source": [
    "# Introduction\n",
    "\n",
    "Hong Kong prides itself in it's ability to provide potable water directly to people's homes straight out of the tap.  But how is it down the line?  In this project I want dive into the water parameter data collected from the territory's major rivers to find out it's current state and to learn which river is the cleanest.\n",
    "\n",
    "## Methodology\n",
    "\n",
    "Hong Kong's Environment Protection Department (EPD) collects 48 different physiochemical water parameters.  Since these parameters cannot be directly compared with one another, the use of an index can help us effectively compare the rivers.\n",
    "\n",
    "### Water Quality Index (WQI)\n",
    "Most people are familiar with AQI (air quality index) but there's also one for water.  Hong Kong's EPD defines it's own WQI calculation based on three parameters out of the 48: Dissolved Oxygen, Biological Oxygen Demand, and Ammonia-Nitrogen.  International calculations of WQI typically uses at least 5-6 different parameters reflects upon a water's cleanliness.  Since EPD already collects such a comprehensive range of water parameters, I decided to use the international calculation that should provide a more complete look at the water's quality.\n",
    "\n",
    "The methods for our calculation will reference the following page:\n",
    "\n",
    "http://www.sarasota.wateratlas.usf.edu/library/learn-more/learnmore.aspx?toolsection=lm_wqi#calculations\n",
    "\n",
    "#### Parameters\n",
    "1. Water clarity: turbidity (NTU) and total suspended solids\n",
    "2. Dissolved oxygen: Dissolved oxygen concentration (mg/l);\n",
    "3. Oxygen demand: biochemical oxygen demand (mg/l), chemical oxygen demand (mg/l) and/or total organic carbon (mg/l);\n",
    "4. Nutrients: total nitrogen (mg/l), and/or total phosphorus (mg/l);\n",
    "5. Bacteria: total coliform (# per mg/l) and/or fecal coliform (# per mg/l).\n",
    "\n",
    "This index's score ranges from 0 to 100 where the lower the score, the better.\n",
    "\n",
    "| WQI   | Rating |\n",
    "|-------|--------|\n",
    "| 0-45  | Good   |\n",
    "| 45-60 | Fair   |\n",
    "| >60   | Poor   |"
   ]
