    "## Feature Description\n",
    "\n",
    "### Clarity\n",
    "__Turbidity (NTU)__ - Turbidity is a fancy way of saying clarity.  The cloudier the water, the more turbid it is.\n",
    "\n",
    "### Oxygen Availabilty\n",
    "__Dissolved Oxygen (mg/L)__ - DO doesn't really represent how clean water is but the higher the DO, the better the water's ability to purify itself by sustaining good biodiversity.\n",
    "\n",
    "### Oxygen Demand\n",
    "__Total Organic Carbon (mg/L)__, total concentration of organic carbon.  Organic carbon can come from all kinds of organic matter, eg. faeces, decaying matter, etc.\n",
    "\n",
    "__5-Day Biochemical Oxygen Demand (mg/L)__, or BOD5 in short, measures the amount of oxygen used after a 5-day incubation period.  What this represents is the amount of organic matter in the water.  The lower the better.\n",
    "\n",
    "__Chemical Oxygen Demand (mg/L)__, or COD, is very similar to BOD5 but the incubation process is sped up using some chemical processes.  This broadly represents the amount of foreign chemical substance in water.\n",
    "\n",
    "### Nutrients\n",
    "__Total Nitrogen (mg/L)__, \n",
    "\n",
    "__Total Phosphorus (mg/L)__,\n",
    "\n",
    "\n",
    "### Bacteria\n",
    "__Faecal Coliforms (counts/100mL)__ - This parameter is an indicator of ðŸ’© bacteria in the water.  A high level suggests that untreated sewage/adventurous outdoor toilet goer may be leeching into the river."
   ]
